import SearchBar from "../searchbar/SearchBar";


import "./navBar.css" 

export default function NavBar({onSearch, random}) {
    return (
    <div className="nav-container">
        <SearchBar onSearch={onSearch}/>

        <button className="random" onClick={random}>
            ADD RANDOM 
        </button>
    </div>
    );
}
